import SavingsItem from "./SavingsItem";
function expenses(props) {
  return (
    <div>
      <SavingsItem
        title={props.savings[0].title}
        amount={savings[0].amount}
        date={savings[0].date}
      ></SavingsItem>
      <SavingsItem
        title={savings[1].title}
        amount={savings[1].amount}
        date={savings[1].date}
      ></SavingsItem>
      <SavingsItem
        title={savings[2].title}
        amount={savings[2].amount}
        date={savings[2].date}
      ></SavingsItem>
      <SavingsItem
        title={savings[3].title}
        amount={savings[3].amount}
        date={savings[3].date}
      ></SavingsItem>
    </div>
  );
}
